-- ----------------------------
-- Table structure for `receive_sample`
-- ----------------------------
DROP TABLE IF EXISTS `receive_sample`;
CREATE TABLE `receive_sample` (
  `receive_sample_id` char(32) NOT NULL DEFAULT '' COMMENT '抽样单编号',
  `report_id` char(32) DEFAULT NULL COMMENT '报告编号',
  `sample_type` varchar(64) DEFAULT NULL COMMENT '样品类别',
  `check_type` varchar(64) DEFAULT NULL COMMENT '检验类型',
  `entrusted_unit` varchar(128) DEFAULT NULL COMMENT '委托单位(或人)',
  `entrusted_unit_address` varchar(256) DEFAULT NULL COMMENT '委托单位地址',
  `entrusted_user_phone` varchar(16) DEFAULT NULL COMMENT '委托人号码',
  `entrusted_user_email` varchar(64) DEFAULT NULL COMMENT '委托人邮箱',
  `inspected_unit` varchar(128) DEFAULT NULL COMMENT '受检单位',
  `inspected_unit_address` varchar(256) DEFAULT NULL COMMENT '受检单位地址',
  `inspected_user` varchar(32) DEFAULT NULL COMMENT '受检联系人',
  `inspected_user_phone` varchar(32) DEFAULT NULL COMMENT '受检联系人电话',
  `inspected_user_email` varchar(64) DEFAULT NULL COMMENT '受检联系人邮箱',
  `sample_address` varchar(256) DEFAULT NULL COMMENT '抽样地点',
  `sample_name` varchar(128) DEFAULT NULL COMMENT '抽样名称',
  `sample_link` varchar(64) DEFAULT NULL COMMENT '抽样环节',
  `sample_trademark` varchar(128) DEFAULT NULL COMMENT '商标',
  `sample_circulate` varchar(64) DEFAULT NULL COMMENT '样品流通方式',
  `sample_circulate_date` datetime DEFAULT NULL COMMENT '样品流通日期',
  `sample_date` datetime DEFAULT NULL COMMENT '抽样时间',
  `sample_way` varchar(32) DEFAULT NULL COMMENT '抽样方式',
  `specification_model` varchar(64) DEFAULT NULL COMMENT '规格型号',
